from typing import List
from functools import lru_cache
from collections import deque

class Solution:
    def minimumCost(self, target: str, words: List[str], costs: List[int]) -> int:

        words = zip(costs, words)
        uwords = {}
        for c, w in words:
            if w in uwords:
                uwords[w] = min(uwords[w], c)
            else:
                uwords[w] = c

        dp = [float("inf")] * (len(target)+1)
        dp[0] = 0

        for i in range(len(target)):

            for w, c in uwords.items():
                if i+len(w) >= len(dp):
                    continue
                if dp[i+len(w)] <= dp[i] + c:
                    continue
                if target[i:i+len(w)] != w:
                    continue

                dp[i+len(w)] = min(dp[i+len(w)], dp[i] + c)

        if dp[-1] == float("inf"):
            print(-1)
            return -1

        print(dp[-1])
        return dp[-1]

